import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import axios from 'axios'
import {useState, useEffect} from 'react';    

function BelowHeader() {
    const [persondata, setpersondata] = useState({});      
        
        useEffect(() => {
          getData();     
          
          async function getData() {
            axios
              .post('https://api.meetworks.in/users/get_unique_jobseeker_profile', {
                jobseeker_id: "614b410c2c4b197356a37f18",        
              })
              .then(function (response) {
                console.log(response.data);
                setpersondata(response.data)
              })
              .catch(e => {
                  console.log(e)
              })
            }  
        },[])  

        console.log(persondata)
    

    return (      

            <div>
             <div id="Discovery" className="fhhfh">
            
              
            <div id="hdhhd" className="hfhfh">
                <div className="jaldil">
                <img className= "Aasdg" src={persondata.user_image_url} />
            </div>
            <div className="jaldil">
                <p className="dhhdhd">Sahil Suresh Jaju
                    &nbsp;<line className="nfffjf"></line>&nbsp;
                <i className="jffbfk far fa-map-marker-alt"></i>
                <span className="nfnff">&nbsp; Lucknow,Uttar Pradesh</span></p>
                
                <br />
                <span className="hdhufj"><FontAwesomeIcon icon="coffee" /> &nbsp; EXPERIENCE</span>
                 
                <span className="hfhddf">2 yrs Exp</span><br /><br />
                 <div> 
                    <p className="CompanyName">Company_Name<br />
                    <span className="JobTitle">JobTitle</span><br />   
                    <span className="TimePeriod">TimePeriod</span></p>
                    <span><p className="AboutRole">jfhgjb kjaejvk m jdjdjj </p></span>     
                </div><br />      


                <span className="Education"><i className="fas fa-graduation-cap"></i> &nbsp; EDUCATION</span><br /><br />
                <div> 
                    <span className="EducationDegree">EducationDegree</span><br />
                    <span className="Institute">Institute</span>
                </div>  

            </div>

        </div>
        <button className="jdhdh">Share</button>
        </div> 
        
        <div id="Invited" className="fhhfh">
            dndjfnjfnjfndjjjfjfjfjjjjjj fff
        </div>

        <div id="Support" className="fhhfh">
            dndjfnjfnjfndjjjfjfjfjjjjjj fff
        </div>

        </div> 
    )
}

export default BelowHeader
